import './LineList.css';
import Line from './Line.js';
import {useState} from 'react';

function LineList(props) {
    const [tapLine, setTapLine] = useState([props.listData[0].key]);

    return(
        <div>
            <ul type={"none"}>
        {props.listData.map(data =>
        <Line key={data.key}
              value={data.value}
              onTapLine={setTapLine}/>)}
            </ul>
        </div>
    )

}




export default LineList;
